        `Your Yearly income before tax title- is ${yourOtherHouseholdIncomeTitle}`
      );
    }
  }
  verifyApplicationReviewPageUrl() {
    expect(browser.getUrl()).contains("/review-application");
    console.log("Now on the review application page");
  }

  checkStatusPageValidationErrorDisplays(message) {
    var expected_error_message = message;
    if (message.includes("Please ensure this value is correct.")) {
      let actual_income_amount_hint_message =
        this.yearlyIncomeWarning.getText();
      this.yearlyIncomeWarning.scrollIntoView();
      expect(actual_income_amount_hint_message).equal(expected_error_message);
    } else if (message.includes("Please enter a valid date.")) {
      let actual_bank_opening_warning_message =
        this.accountOpenWarning.getText();
      browser.waitUntil(
        () =>
          this.accountOpenWarning.getText() === "Please enter a valid date.",
        {
          timeout: 7000,
        }
      );

      this.accountOpenWarning.scrollIntoView();
      expect(actual_bank_opening_warning_message).equal(expected_error_message);
    } else if (
      message.includes(
        "Please enter a valid amount in whole pounds, up to 6 digits, without decimals."
      )
    ) {
      let actual_mortgage_warning_message =
        this.accountMortgageWarning.getText();
      this.accountMortgageWarning.scrollIntoView();
      expect(actual_mortgage_warning_message).equal(expected_error_message);
    } else if (
      message.includes(
        "Please enter a valid amount in whole pounds, up to 7 digits, without decimals."
      )
    ) {
      let actual_limit_warning_message;
      if (this.yearlyIncomeLimitWarning.isExisting()) {
        actual_limit_warning_message = this.yearlyIncomeLimitWarning.getText();
        this.yearlyIncomeLimitWarning.scrollIntoView();
        expect(actual_limit_warning_message).equal(expected_error_message);
      } else if (this.otherIncomeLimitWarning.isExisting()) {
        actual_limit_warning_message = this.otherIncomeLimitWarning.getText();
        this.otherIncomeLimitWarning.scrollIntoView();
        expect(actual_limit_warning_message).equal(expected_error_message);
      }
    } else {
      throw new Error(
        "The message is: " + message + "but this is not displayed"
      );
    }
  }

  populatedAllMandatoryFields(
    monthly_mortgage_rent,
    yearly_income,
    sort_code_one,
    sort_code_two,
    sort_code_three,
    bank_account_number,
    bank_month_open,
    bank_year_open
  ) {
    this.monthMortgageRentInputField.setValue(
      clearInputField(this.monthMortgageRentInputField)
    );
    this.monthMortgageRentInputField.setValue(monthly_mortgage_rent);
    console.log(
      `Entering the mortgage rent amount of ${monthly_mortgage_rent}`
    );
    this.yearlyIncomeBeforeTaxInputField.setValue(
      clearInputField(this.yearlyIncomeBeforeTaxInputField)
    );
    this.yearlyIncomeBeforeTaxInputField.setValue(yearly_income);
    console.log(`Entering the yearly income amount of ${yearly_income}`);
    this.sortCodeFirstInput.scrollIntoView();
    this.sortCodeFirstInput.setValue(clearInputField(this.sortCodeFirstInput));
    this.sortCodeFirstInput.setValue(sort_code_one);
    console.log(`Entering the first part of the sort as ${sort_code_one}`);
    this.sortCodeSecondInput.setValue(
      clearInputField(this.sortCodeSecondInput)
    );
    this.sortCodeSecondInput.setValue(sort_code_two);
    console.log(`Entering the second part of the sort as ${sort_code_two}`);
    this.sortCodeThirdInput.scrollIntoView();
    this.sortCodeThirdInput.setValue(clearInputField(this.sortCodeThirdInput));
    this.sortCodeThirdInput.setValue(sort_code_three);
    console.log(`Entering the third part of the sort as ${sort_code_three}`);
    this.bankAccountNumberInputField.scrollIntoView();
    this.bankAccountNumberInputField.setValue(
      clearInputField(this.bankAccountNumberInputField)
    );
    this.bankAccountNumberInputField.setValue(bank_account_number);
    console.log(`Entering the bank account number as ${bank_account_number}`);
    this.monthInputField.scrollIntoView();
    this.monthInputField.setValue(clearInputField(this.monthInputField));
    this.monthInputField.setValue(bank_month_open);
    console.log(
      `Entering the month the bank account opened as ${bank_month_open}`
