import { assert, expect } from "chai";
import verifyNextButtonText from "../../support/common_assertions/verifyNextButton";
import verifyLeaveApplicationButtonText from "../../support/common_assertions/verifyLeaveApplicationButton";
import environment from "../config/environments.conf";
import progressBarData from "../../data/progressBar_constant";
class YourNameAndAddressPage {
  /**
   * Define page elements
   */

  goToYourNameAndAddressPage() {
    return browser.url("/about-you");
  }

  get pageUrl() {
    return browser.getUrl();
  }

  get yourNameAndAddressPageTitle() {
    return $("h2[data-test='heading-1-content']");
  }

  get customerFullName() {
    return $("[data-testid='name-summary-title'] strong");
  }

  get titleTwo() {
    return $("h2[data-test='heading-2-content']");
  }

  get currentAddressTitle() {
    return $("[data-testid='address-summary-title'] strong");
  }

  get addressLineOne() {
    return $("dd[data-testid='address-summary-0']");
  }

  get addressLineTwo() {
    return $("dd[data-testid='address-summary-1']");
  }

  get postCode() {
    return $("dd[data-testid='address-summary-2']");
  }

  get dontLiveAtAddressTitle() {
    return $("[data-testid='change-details-text']");
  }

  get changeYourDetailsLink() {
    return $("[data-testid='leave-application-link']");
  }

  get bannerInfoOne() {
    return $("[data-test='component-alert']");
  }

  get progressBarNumNameAndAddress() {
    return $("[data-test='component-progress-tracker-step-0'] div");
  }

  get progressBarTextNameAndAddress() {
    return $("[data-test='component-progress-tracker-step-0'] span");
  }

  /**
   * Define page functions
   */

  checkPageUrl() {
    expect(browser.getUrl()).to.eql(environment.dev3_env + "about-you");
  }

  checkYourNamePageTitleText() {
    let yourNameAndAddressPageTitleText =
      this.yourNameAndAddressPageTitle.getText();
    let expected_yourNameAndAddressPageTitle = "Your name";
    assert(
      yourNameAndAddressPageTitleText.includes(
        expected_yourNameAndAddressPageTitle
      ),
      ` Your name and address title - ${yourNameAndAddressPageTitleText} does not include ${expected_yourNameAndAddressPageTitle}`
    );
  }


  checkCustomerFullName(expected_full_name) {
    let customerName = this.customerFullName.getText();
    assert(
      customerName.includes(expected_full_name),
      `Customer name ${customerName} does not include ${expected_full_name}`
    );
  }

  checkYourAddressTitleText() {
    let titleTwoText = this.titleTwo.getText();
    let expected_TitleTwoText = "Your address";
    assert(
      titleTwoText.includes(expected_TitleTwoText),
      ` Your address title - ${titleTwoText} does not include ${expected_TitleTwoText}`
    );
  }

  checkCurrentAddressSubTitleText() {
    let currentAddressSubTitleText = this.currentAddressTitle.getText();
    let expected_currentAddressSubTitleText = "Current address:";

    assert(
      currentAddressSubTitleText.includes(expected_currentAddressSubTitleText),
      `Current Address - ${currentAddressSubTitleText} does not include ${expected_currentAddressSubTitleText}`
    );
  }


  checkCustomerAddressLineOne(expected_address_line_one) {
    let address_line_one = this.addressLineOne.getText();
    assert(
      address_line_one.includes(expected_address_line_one),
      `Customer last name ${address_line_one} does not include ${expected_address_line_one}`
    );
  }


  checkCustomerAddressLineTwo(expected_address_line_two) {
    if (expected_address_line_two === null) {
      console.log("Customer does not have a second address line");
    } else {
      let address_line_two = this.addressLineTwo.getText();
      assert(
        address_line_two.includes(expected_address_line_two),
        `Customer last name ${address_line_two} does not include ${expected_address_line_two}`
      );
    }
  }


  checkCustomerPostCode(expected_postcode) {
    let customerPostCode = this.postCode.getText();
    assert(
      customerPostCode.includes(expected_postcode),
      `Customer last name ${customerPostCode} does not include ${expected_postcode}`
    );
  }

  checkThePresencesOfDontLiveAtAddressLinkText() {
    let doNotLiveAtAddress = this.dontLiveAtAddressTitle.getText();
    let expected_doNotLiveAtAddressText = "Don’t live at this address?";
    assert(
      doNotLiveAtAddress.includes(expected_doNotLiveAtAddressText),
      `dontLiveAtAddress ${doNotLiveAtAddress} does not include ${expected_doNotLiveAtAddressText}`

    );
  }

  checkThePresencesOfChangeYourDetailsLinkText() {
    let changeYourDetailsLinkText = this.changeYourDetailsLink.getText();
    let expected_ChangeYourDetailsText = "Go back and change your details";
    assert(
      changeYourDetailsLinkText.includes(expected_ChangeYourDetailsText),
      `dontLiveAtAddress change your details link ${changeYourDetailsLinkText} does not include ${expected_ChangeYourDetailsText}`
    );
  }

  checkThePresencesOfBannerInfoOneText() {
    let bannerInfoOne = this.bannerInfoOne.getText();
    let expected_BannerInfoOneText =
      "For security reasons, we have to use the name and address registered to your Argos account for your application.";
    assert(
      bannerInfoOne.includes(expected_BannerInfoOneText),
      `dontLiveAtAddress banner info ${bannerInfoOne} does not include ${expected_BannerInfoOneText}`
    );
  }

  checkCorrectYourNameAndYourAddressPageContentIsDisplayed() {
    this.checkYourNamePageTitleText();
    this.checkYourAddressTitleText();
    this.checkCurrentAddressSubTitleText();
    this.checkThePresencesOfDontLiveAtAddressLinkText();
    this.checkThePresencesOfChangeYourDetailsLinkText();
    this.checkThePresencesOfBannerInfoOneText();
    verifyNextButtonText();
    verifyLeaveApplicationButtonText();
  }

  checkCorrectCustomerNameDetailsAreDisplayed(expected_fullname) {
    this.checkCustomerFullName(expected_fullname);
  }

  checkCorrectCustomerAddressDetailsAreDisplayed(
    expected_address_line_one,
    expected_address_line_two,
    expected_postcode
  ) {
    this.checkCustomerAddressLineOne(expected_address_line_one);
    this.checkCustomerAddressLineTwo(expected_address_line_two);
    this.checkCustomerPostCode(expected_postcode);
  }

  verifyProgressBarNumberIsHighlighted(expBarStatusNumber) {
    let actualProgressBarNumberColor =
      this.progressBarNumNameAndAddress.getCSSProperty("background")["value"];
      let expProgressBarNumberBackgroundColour=progressBarData.progressBarData[0];
    expect(actualProgressBarNumberColor).to.includes(
      expProgressBarNumberBackgroundColour
    );

    let actualProgressBarNum = this.progressBarNumNameAndAddress.getText();
    expect(actualProgressBarNum).to.eql(expBarStatusNumber);
  }

  verifyProgressBarTextIsHighlighted(expBarStatusText) {
    let actualProgressBarTextColor =
      this.progressBarTextNameAndAddress.getCSSProperty("font-weight")["value"];
      let expProgressBarTextColourSafari=progressBarData.progressBarData[1];
      let expProgressBarTextColour=progressBarData.progressBarData[2];
    if (actualProgressBarTextColor === expProgressBarTextColourSafari) {
      expect(actualProgressBarTextColor).to.equal(
        expProgressBarTextColourSafari
      );
    } else
      expect(actualProgressBarTextColor).to.equal(expProgressBarTextColour);

    let actualProgressBarText = this.progressBarTextNameAndAddress.getText();
    expect(actualProgressBarText).to.eql(expBarStatusText);
  }
}
export default new YourNameAndAddressPage();

