      expect(this.checkBoxErrorMessage.getText()).eql(error_message);
    } else if (condition === false) {
      browser.waitUntil(
        () => this.checkBoxErrorMessage.getText() != error_message
      ),
        {
          timeout: 5000,
        };
      expect(this.checkBoxErrorMessage.getText()).to.not.eql(error_message);
    }
  }

  checkSideDrawContent(content) {
    let actual_data;
    switch (content) {
      case "Quote terms":
        actual_data = this.sideDrawQuoteTermsTitle.getText();
        expect(side_drawer.Quote_terms_title).eql(actual_data);
        break;
      case "Trolley total:":
        actual_data = this.sideDrawTrolleyTotalHeading.getText();
        expect(side_drawer.Trolley_total_heading).eql(actual_data);
        break;
      case "Trolley total content":
        actual_data = this.sideDrawTrolleyTotalSubText.getText();
        expect(side_drawer.Trolley_total_subtext).eql(actual_data);
        break;
      case "Cost per month:":
        actual_data = this.sideDrawCostPerMonthTitle.getText();
        expect(side_drawer.Cost_per_month_heading).eql(actual_data);
        break;
      case "Cost per month content":
        actual_data = this.sideDrawCostPerMonthSubText.getText();
        expect(side_drawer.Cost_per_month_subtext).eql(actual_data);
        break;
      case "Number of monthly payments:":
        actual_data = this.sideDrawDNumberOfMonthlyTitle.getText();
        expect(side_drawer.Number_of_monthly_payments_heading).eql(actual_data);
        break;
      case "Number of monthly payments content":
        actual_data = this.sideDrawDNumberOfMonthlySubText.getText();
        expect(side_drawer.Number_of_monthly_payments_subtext).eql(actual_data);
        break;
      case "APR:":
        actual_data = this.sideDrawAPRTitle.getText();
        expect(side_drawer.APR_heading).eql(actual_data);
        break;
      case "Representative APR content":
        actual_data = this.sideDrawAPRSubText.getText();
        expect(side_drawer.APR_subtext).eql(actual_data);
        break;
      case "Total charge for credit:":
        actual_data = this.sideDrawTotalChargeTitle.getText();
        expect(side_drawer.Total_charge_for_credit_heading).eql(actual_data);
        break;
      case "Total charge for credit content":
        actual_data = this.sideDrawTotalChargeSubText.getText();
        expect(side_drawer.Total_charge_for_credit).eql(actual_data);
        break;
      case "Total payable:":
        actual_data = this.sideDrawTotalPayableTitle.getText();
        expect(side_drawer.Total_payable_heading).eql(actual_data);
        break;
      case "Total payable content":
        actual_data = this.sideDrawTotalPayableSubText.getText();
        expect(side_drawer.Total_payable_subtext).eql(actual_data);
        break;
      default:
        throw new Error("Content does not exist");
    }
  }

  checkHighProbabilityContent(content) {
    let actual_data;
    switch (content) {
      case "My quote":
        actual_data = this.myQuotePageTitle.getText();
        expect(content).eql(actual_data);
        break;
      case "Loan probability":
        actual_data = this.loanProbability.getText();
        expect(content).eql(actual_data);
        browser.break;
      case "probability imagery":
        this.loanImage.waitForDisplayed({ timeout: 4000 });
        expect(this.loanImage.isExisting()).eql(true);
        break;
      case "accept content":
        actual_data = this.highProbabilityContent.getText();
