        expect(this.trolleyTotal.isExisting()).eql(true);
        break;
      case "Cost per month":
        actual_data = this.costPerMonthSubText.getText();
        expect(content).eql(actual_data);
        break;
      case "Cost per month amount":
        expect(this.costPerMonth.isExisting()).eql(true);
        break;
      case "Number of monthly payments":
        actual_data = this.numberOfMonthlyPaymentsSubText.getText();
        expect(content).eql(actual_data);
        break;
      case "Number of monthly payments amount":
        expect(this.numberOfMonthlyPayment.isExisting()).eql(true);
        break;
      case "APR (Annual Percentage Rate)":
        actual_data = this.annualPercentageRateSubText.getText();
        expect(content).eql(actual_data);
        break;
      case "APR amount":
        expect(this.annualPercentageRate.isExisting()).eql(true);
        break;
      case "Total charge for credit":
        actual_data = this.totalChargeForCreditSubText.getText();
        expect(content).eql(actual_data);
        break;
      case "Total charge for credit amount":
        expect(this.totalChargeForCreditSubText.isExisting()).eql(true);
        break;
      case "Total payable":
        actual_data = this.totalPayableSubText.getText();
        expect(content).eql(actual_data);
        break;
      case "Total payable amount":
        expect(this.totalPayable.isExisting()).eql(true);
        break;
      case "Learn more link":
        expect(this.learnMoreLink.isExisting()).eql(true);
        break;
      case "Credit subject to status":
        expect(this.creditSubjectSubText.isExisting()).eql(true);
        break;
      case "T&Cs apply":
        expect(this.termsAndConditions.isExisting()).eql(true);
        break;
      case "Checkbox content":
        actual_data = this.termsAndConditionsContent.getText();
        expect(my_quote.my_quote_terms_conditions_content).eql(actual_data);
        break;
      default:
        throw new Error("Content does not exist");
    }
  }

  verifyProgressBarNumberIsHighlightedQuoteScreen(expBarStatusNumber) {
    let actualProgressBarNumberColor =
      this.progressBarNumQuoteScreen.getCSSProperty("background")["value"];
      let expProgressBarNumberBackgroundColour=progressBarData.progressBarData[0];
      expect(actualProgressBarNumberColor).to.includes(
      expProgressBarNumberBackgroundColour
    );

    let actualProgressBarNum = this.progressBarNumQuoteScreen.getText();
    expect(actualProgressBarNum).to.eql(expBarStatusNumber);
  }

  verifyProgressBarTextIsHighlightedQuoteScreen(expBarStatusText) {
    let actualProgressBarTextColor =
      this.progressBarTextQuoteScreen.getCSSProperty("font-weight")["value"];
      let expProgressBarTextColourSafari=progressBarData.progressBarData[1];
      let expProgressBarTextColour=progressBarData.progressBarData[2];
      if (actualProgressBarTextColor === expProgressBarTextColourSafari) {
      expect(actualProgressBarTextColor).to.equal(
        expProgressBarTextColourSafari
      );
    } else
      expect(actualProgressBarTextColor).to.equal(expProgressBarTextColour);

    let actualProgressBarText = this.progressBarTextQuoteScreen.getText();
    expect(actualProgressBarText).to.eql(expBarStatusText);
  }
}

export default new MyQuotePage();

