const expect = require("chai").expect;

class HeaderPage {
  /**
   *** define css locators
   */

  get header() {
    return $("div#root > .cMxocQ.sc-gKAblj");
  }

  get argosLogo() {
    return $("[fill='#d42114']");
  }

  get secureIcon() {
    return $('#root  header  [data-testid="secure-icon"]');
  }

  get secureIconText() {
    return $('#root  header  [data-testid="secure-icon"] p');
  }

  /**
   *** define functions / methods
   */

  verifyHeaderComponent() {
    this.header.waitForDisplayed({ timeout: 3000 });
    let isExisting = this.header.isExisting();
    expect(isExisting).to.eql(true);
    console.log(isExisting);
  }

  verifyArgosLogoVisibility() {
    this.argosLogo.waitForDisplayed({ timeout: 3000 });
    let isExisting = this.argosLogo.isExisting();
    expect(isExisting).to.eql(true);
    console.log(isExisting);
  }

  verifySecureIconPresence() {
    this.secureIcon.waitForDisplayed({ timeout: 3000 });
    let isExisting = this.secureIcon.isExisting();
    expect(isExisting).to.eql(true);
    console.log(isExisting);
  }
}

export default new HeaderPage();

