import { assert, expect } from "chai";
import important_info_constants from "../../data/important_informationpage_constants";

class ImportantInformationPage {
  /**
   * Define page elements
   */

  get title() {
    return $("[data-test='component-heading-content']");
  }

  get content() {
    return $(".Headingstyles__Intro-sc-1vcwzh9-3.prkaT > p");
  }

  get title_One() {
    return $(".getlQo.sc-pNWxx > h2:nth-of-type(1)");
  }

  get content_One() {
    return $(".getlQo.sc-pNWxx > p:nth-of-type(1)");
  }

  get title_Two() {
    return $(".getlQo.sc-pNWxx > h2:nth-of-type(2)");
  }
  get content_Two() {
    return $(".getlQo.sc-pNWxx > p:nth-of-type(2)");
  }

  get title_Three() {
    return $(".getlQo.sc-pNWxx > h2:nth-of-type(3)");
  }

  get content_Three() {
    return $(".getlQo.sc-pNWxx > p:nth-of-type(3)");
  }

  get title_Four() {
    return $(".getlQo.sc-pNWxx > h2:nth-of-type(4)");
  }

  get content_Four() {
    return $(".getlQo.sc-pNWxx > p:nth-of-type(4)");
  }

  get title_Five() {
    return $(".getlQo.sc-pNWxx > h2:nth-of-type(5)");
  }

  get content_Five() {
    return $(".getlQo.sc-pNWxx > p:nth-of-type(5)");
  }

  get TermsAndConditionsText() {
    return $(".koOoEl.sc-iCoHVE span");
  }

  /**
   * Define page functions
   */

  verifyImportantInformationPageUrl() {
    let expected_url = "/important-information";
    browser.waitUntil(() => browser.getUrl().includes(expected_url), {
      timeout: 5000,
      timeoutMsg: `The expected URL did not include the following endpoint ${expected_url}`,
    });
    expect(browser.getUrl()).contains(expected_url);
  }

  checkImportantInformationContent(content) {
    let actual_data;
    switch (content) {
      case "Important info":
        actual_data = this.title.getText();
        expect(important_info_constants.Heading).eql(actual_data);
        break;
      case "Before you apply for an Argos Monthly Payment Plan":
        actual_data = this.content.getText();
        expect(important_info_constants.Content).eql(actual_data);
        break;
      case "So,what’s an Argos Monthly Payment Plan?":
        actual_data = this.title_One.getText();
        expect(important_info_constants.Title_one).eql(actual_data);
        break;
      case "Content1":
        actual_data = this.content_One.getText().replace(/(\r\n|\n|\r)/gm, "");
        expect(important_info_constants.Content_one).to.include(actual_data);
        break;
      case "How does an Argos Monthly Payment Plan work":
        actual_data = this.title_Two.getText();
        expect(important_info_constants.Title_two).eql(actual_data);
        break;
      case "Content2":
        actual_data = this.content_Two.getText();
        expect(important_info_constants.Content_two).to.include(actual_data);
        break;
      case "Remember.":
        actual_data = this.title_Three.getText();
        expect(important_info_constants.Title_three).eql(actual_data);
        break;
      case "Content3":
        actual_data = this.content_Three
          .getText()
          .replace(/(\r\n|\n|\r)/gm, "")
          .replace(/(\r\n|\n|\r)/gm, "");
        expect(important_info_constants.Content_three).to.include(actual_data);
        break;
      case "What’s the best way to manage my Argos Monthly Payment Plan?":
        actual_data = this.title_Four.getText();
        expect(important_info_constants.Title_four).eql(actual_data);
        break;
      case "You’ll need to make monthly payments,as shown…":
        actual_data = this.content_Four.getText();
        expect(important_info_constants.Content_four).eql(actual_data);
        break;
      case "finally":
        actual_data = this.title_Five.getText();
        expect(important_info_constants.Title_five).eql(actual_data);
        break;
      case "You’ll need to make monthly payments":
        actual_data = this.content_Five.getText();
        expect(important_info_constants.Content_five).eql(actual_data);
        break;
      case "Read our full T&Cs":
        actual_data = this.TermsAndConditionsText.getText().trimEnd();
        expect(important_info_constants.Link1).include(actual_data);
        break;
      default:
        throw new Error(
          "The content that your comparing against does not exist"
        );
    }
  }
}
export default new ImportantInformationPage();

