  checkStatusPageValidationErrorDisplays(message) {
    var expected_error_message = message;
    if (
      message.includes("Please select how long you’ve been at this address.")
    ) {
      if (this.lengthOfCurrentAddressErrorMessageValidation.isExisting()) {
        let actual_address_status_error_message =
          this.lengthOfCurrentAddressErrorMessageValidation.getText();
        expect(actual_address_status_error_message).equal(
          expected_error_message
