    } else if (
      message.includes(
        "You must be less than 83 years old at the end of the loan term."
      )
    ) {
      let actual_older_age_error_message =
        this.ageErrorMessageValidation.getText();
      expect(actual_older_age_error_message).equal(expected_error_message);
    } else if (
      message.includes(
        "We need your address for the previous 2 years to perform a credit check."
      )
    ) {
      let actual_years_error_message =
        this.currentAddressErrorValidation.getText();
      expect(actual_years_error_message).equal(expected_error_message);
    } else if (message.includes("Please enter a valid email address")) {
      let actual_email_format_error_message =
        this.emailFormatErrorMessageValidation.getText();
      expect(actual_email_format_error_message).equal(expected_error_message);
    } else if (message.includes("valid mobile phone number")) {
      let actual_mobile_format_error_message =
        this.mobileFormatErrorMessageValidation.getText();
      expect(actual_mobile_format_error_message).equal(expected_error_message);
    } else if (
      message.includes(
        "You must be 18 years old or over in order to progress with your application."
      )
    ) {
      let actual_age_error_message = this.ageErrorMessageValidation.getText();
      expect(actual_age_error_message).equal(expected_error_message);
    } else if (message.includes("Please enter house name/number.")) {
      let actual_previous_house_number_error_message =
        this.previousAddressHouseNumberNameErrorMessage.getText();
      this.previousAddressHouseNumberNameErrorMessage.scrollIntoView();
      expect(actual_previous_house_number_error_message).equal(
        expected_error_message
      );
    } else if (message.includes("Please enter street address.")) {
      let actual_previous_street_error_message =
        this.previousStreetNameErrorMessage.getText();
      this.previousStreetNameErrorMessage.scrollIntoView();
      expect(actual_previous_street_error_message).equal(
        expected_error_message
      );
    } else if (message.includes("Please enter town.")) {
      let actual_previous_town_error_message =
        this.previousTownErrorMessage.getText();
      this.previousTownErrorMessage.scrollIntoView();
      expect(actual_previous_town_error_message).equal(expected_error_message);
    } else if (message.includes("Please enter postcode.")) {
      this.previousPostCodeErrorMessage.waitForDisplayed({ timeout: 4000 });
      let actual_previous_postcode_error_message =
        this.previousPostCodeErrorMessage.getText();
      this.previousPostCodeErrorMessage.scrollIntoView();
      expect(actual_previous_postcode_error_message).equal(
        expected_error_message
      );
    } else {
      throw new Error(
        "The message is: " + message + "but this message is not displayed"
      );
    }
  }

