import { Then } from "@cucumber/cucumber";
import yourFinanceDetailsPage from "../../pages/yourFinanceDetails.page";
import yourOccupationPage from "../../pages/yourOccupation.page";
import yourDetailsAndWhereYouLivePage from "../../pages/yourDetailsAndWhereYouLive.page";
import checkMyApplicationPage from "../../pages/checkMyApplication.page";
import importantInformationPage from "../../pages/importantInformation.page";
import rePaymentCalculatorPage from "../../pages/rePaymentCalculator.page";

Then(
  /^The customer will progress to the next screen - Your Finance Details$/,
  () => {
    yourFinanceDetailsPage.checkYourFinanceDetailsPageTitle();
  }
);

Then(/^Occupation and Employer name fields will be greyed out$/, () => {
  yourOccupationPage.checkEmployerAndOccupationFieldsAreGreyedOut();
});

Then(
  /^The customer will not be able to select populate Occupation and Employer name fields$/,
  () => {
    yourOccupationPage.checkEmployerFieldIsNotClickable();
  }
);

Then(
  /^The customer will progress to next screen Finance details upon clicking the Continue button$/,
  () => {
    yourOccupationPage.continueToFinanceDetailsScreenAndVerifyPageTitle();
  }
);

Then(
  /^The customer will be presented with the validation message: (.*)$/,
  (message) => {
    yourOccupationPage.checkEmploymentStatusErrorDisplays(message);
  }
);

Then(/^The customer will not progress to next screen$/, () => {
  yourOccupationPage.verifyOccupationPageUrl();
});

Then(
  /^Customer will be constrained to capturing max 40 character length$/,
  () => {
    yourOccupationPage.verifyOccupationPageUrl();
  }
);

Then(
  /^Customer will be constrained to capturing max 40 character length$/,
  () => {
    yourOccupationPage.verifyOccupationPageUrl();
  }
);

Then(/^The customer will progress to the next screen Your Occupation$/, () => {
  yourOccupationPage.verifyOccupationPageUrl();
});

Then(
  /^The customer will be presented with the following validation error:(.*)$/,
  (message) => {
    yourDetailsAndWhereYouLivePage.checkStatusPageValidationErrorDisplays(
      message
    );
  }
);

Then(
  /^The customer will not progress to the next screen Your Occupation$/,
  () => {
    yourDetailsAndWhereYouLivePage.verifyYourDetailsAndWherePageUrl();
  }
);

Then(
  /^The customer will progress to the next screen - Check Your Application$/,
  () => {
    checkMyApplicationPage.verifyCheckMyApplicationPageUrl();
  }
);

Then(
  /^The customer will be presented with the error message:(.*)$/,
  (message) => {
    yourFinanceDetailsPage.checkStatusPageValidationErrorDisplays(message);
  }
);

Then(/^The customer will continue to Important information$/, () => {
  importantInformationPage.verifyImportantInformationPageUrl();
});

Then(/^The error validation message will disappear for (.*)$/, (message) => {
  yourDetailsAndWhereYouLivePage.checkErrorValidationMessageDoesNotExist(
    message
  );
});

Then(/^the duration term will be set to (.*)$/, (default_duration) => {
  rePaymentCalculatorPage.verifyDurationTermsLengthText(default_duration);
});

Then(/^the minimum duration will be set to (.*)$/, (minimum_term) => {
  rePaymentCalculatorPage.verifyMinimumTermLengthText(minimum_term);
});

Then(/^the maximum duration will be set to (.*)$/, (maximum_term) => {
  rePaymentCalculatorPage.verifyMaximumTermLengthText(maximum_term);
});

Then(/^the trolley total will be set to (.*)$/, (trolley_amount) => {
  rePaymentCalculatorPage.verifyTrolleyAmount(trolley_amount);
});

Then(/^the cost per month will be set to (.*)$/, (trolley_amount) => {
  rePaymentCalculatorPage.verifyCostPerMonthAmount(trolley_amount);
});

Then(/^the representative APR will be set to (.*)$/, (apr_value) => {
  rePaymentCalculatorPage.verifyAprValue(apr_value);
});

Then(/^the number of payments will be set to (.*)$/, (apr_value) => {
  rePaymentCalculatorPage.verifyNumberOfPayments(apr_value);
});

Then(/^the total charge for credit will be set to (.*)$/, (total_charge) => {
  rePaymentCalculatorPage.verifyTotalCreditCharge(total_charge);
});

Then(/^the total payable will be (.*)$/, (total_payable) => {
  rePaymentCalculatorPage.verifyTotalPayableAmount(total_payable);
});

Then(/^The your occupation section will display (.*)$/, (occupation) => {
  checkMyApplicationPage.checkEmploymentStatus(occupation);
});

Then(/^The customer will be presented with the message: (.*)$/, (message) => {
  checkMyApplicationPage.checkEmploymentStatusErrorDisplays(message);
});

Then(/^The customer proceed to next screen - My quote$/, () => {
  checkMyApplicationPage.checkMyQuotePageIsLoaded();
});

Then(/^The validation message and red box border disappears$/, () => {
  checkMyApplicationPage.checkEmployerErrorIsNotDisplayed();
});

Then(/^The phone number should be displayed in same input format$/, () => {
  // yourDetailsAndWhereYouLivePage.checkPhoneNumberDisplayedInCorrectFormat();
    debugger
    yourDetailsAndWhereYouLivePage.checkMobilePhoneNumberInputFieldTitle()
});

